@thecomeup_foundation is a non-profit organization offering free martial arts training. Their goal is to mentor underprivileged youth to increase their chances of a prosperous future.

If you are in the Oklahoma/OKC area, follow and check them out!

Happy to support and be a part of an organization helping our future!

About this weekend 😁. Thank you everyone who helped me make this fight possible. I get better and learn something new every time I step in and compete. This fight was by far the most I've ever stepped out and tried new things and I loved it so much! I'll be better prepared next time and have more in my tank but I don't regret anything about this weekend. 
I took a last minute muy thai fight and entered this fight knowing this art isn't my specialty.
But within that I unlocked a new me. I tried things I typically don't do and loved it. I haven't competed in 2 years!! Getting back in there meant the world to me.
Angela is a very skilled and talented fighter. I'm thankful to have shared the ring with her. I can't wait to compete again! 

💛Do hard things
💛Be uncomfortable 
💛Constantly grow
💛Take Chances

Until next time!!

